(11256, 181, 1283, 1, 'RF舞曲 - 嶄新的世界 [RF - Beginning Of A New World]', '跟電玩接觸的KS這次為了RF編曲的靈感親自暢玩遊戲本身並深入了解遊戲內容，小編的觀察後感受到…KS嚴重忘我程度玩到他手指頭麻痺！小編覺得很不可思議…這次訪談中KS這次的作品是他遇過最困擾的一次，由於遊戲音效的部分在挑選中無法了解本身音效的本質，由於遊戲限制等級20到第三封測中開放30級這之間只聽到這等級的相關音效，在選擇部份只能挑選長聽見的音效來套在這編曲上。故事並非以往線上遊戲的中古世紀或神話背景，所以音效部分機械科技很難作挑選完全沒有種族之間的語言特色實在很難著手。\r\n\r\n在製作中這段時間KS不斷修改並刪除不必要的旋律，原先計劃以分段式來將種族音樂設計一一代表整首特色，KS將所有元素全部融合而一在以混戰中的音效在將玩家聽覺拉進帶到另一個世界，這是KS拿手的創作概念！在整首歌曲表現KS一貫的創作風格推成出新在創新，似乎KS的努力仍希望對於台灣目前的電音市場不再是只有藥物與搖頭樂劃上等號！KS極力推廣電音的優美華麗樂章！這樣不斷的用心創作讓電音本質更能被大眾聽見並認同電音的優質。\r\n\r\n對於KS之前其他線上遊戲音樂作品，小編希望這次的KS作品能帶來玩家不一樣的感覺，也真的給玩家體會KS電音作品跟其他電音相較之下的特殊風味，給予您在聽覺上的體驗以及偉大的音樂敘訴中真正的電音生命。\r\n\r\n作品年份：2005/02\r\n更多凱斯音樂請至：http://www.kevinsu.com.tw', '2005-02-25 00:00:00', 0000, 16, 0, 3, '', '', 411, '', 'KS (Kevin Su)', '', 'KS (Kevin Su)', '凱斯音樂', '', 0, 1, 0, '2008-12-26 07:06:55', '2015-03-12 13:36:11', '0000-00-00 00:00:00'),
