(11396, 315, 0, 1, 'Send My Car Back (demo)', 'Wow 怎麼會有這麼 dance 的 sad core 歌曲!!!!', '0000-00-00 00:00:00', 0000, 0, 1, 7, '看 Tizzy Bac 的時候\r\n突然刮起大風\r\n樹葉一陣陣灑落\r\n像是電影的情節\r\n\r\n看橙草的時候\r\n突然下起了雨\r\n雨滴一陣陣灑落\r\n是電影黑心的詭計\r\n\r\n氣溫驟降\r\nI can''t take it\r\n穿上毛衣\r\nI really hate it\r\n\r\nPlease send my car back\r\nI don''t want to walk home\r\nI don''t have any money\r\nTo get it back', '', 297, '', 'Ever', 'Ever', 'Ever', '', '', 0, 0, 1, '2008-12-26 21:08:41', '2013-10-07 17:13:42', '0000-00-00 00:00:00'),
(11397, 5603, 2278, 2, 'by this river(PUNKCAN MIX)', '我真的很愛這首歌～\r\n所以REMIX了好幾次\r\n這是第一次\r\n\r\n我不知道我這樣說你能否理解，在第一次聽到這旋律時，我以為時間永遠不會到盡頭，在浪花前進後退的過程中，我以為生命像浪一樣永遠不會停止結束。\r\n\r\n後來我才發現\r\n我們只是像魚一樣\r\n無法記得自己游多遠\r\n所以才一直一直往前游去\r\n', '2010-01-15 00:00:00', 0000, 15, 2, 3, '', '', 333, '', '', '', '', '', '', 1, 1, 0, '2008-12-27 01:01:19', '2015-03-12 13:36:15', '0000-00-00 00:00:00'),
