(11403, 181, 1301, 1, '7856 - KS Remix', '凱斯很久以前在網路平台上因而結識（前：4人幫、重組名：薨樂團）貝斯手：祈安（現任薨樂團吉他手），深入了解後原來祈安搞死亡金屬的，在那時4人幫的作品也不少因而好奇繼續埋進死亡金屬裡，讓祈安洗禮死亡金屬的意義！\n\n7856這首曲子是在4人幫期間的作品，由於想嘗試電子與金屬上的關係，凱斯開始主動邀原始音軌拿來重創編曲為電子音樂融合死亡金屬！所誕生的結晶令人感到新鮮！電子式音樂帶點黑死唱腔，解脫心中的不悅與狂亂自我抒發，聽起來非常爽快。\n\n由於是第一次將不同的領域音樂融合電子音樂，的確讓自己又有一份新的成就感以外也將自己的創作更加多元化！如果你問我死亡金屬的意義，我沒有辦法解釋這真正的涵意，如果你很喜歡！您可以造訪（薨樂團）的網站：http://www.myspace.com/demise6666\n4人幫以前的作品將較之下現在音樂更加殘虐與暴力！非常成熟的死亡金屬風，您可以親至體驗什麼叫做死亡金屬！\n\n4人幫歌曲敘述：\n因不滿鄰居養的狗每晚狂吠，主人又不處理，任其吵到其他鄰居，心中充滿怨恨之作，粗糙的結構，直接的訴出心裡的話。\n\n7856 - KS Remix 作品年份：2004/08\n更多凱斯音樂請至：http://www.kevinsu.com.tw', '2004-08-11 00:00:00', 0000, 0, 2, 3, '每工暗眠欲睏ㄟ時\n不知到底是啥咪情形\n聽到一聲擱一聲ㄟ狗吠\n你家ㄟ狗仔是在吠啥咪\n\n每工暗眠欲睏ㄟ時\n不知到底是啥咪情形\n聽到一聲擱一聲ㄟ狗吠\n你家ㄟ狗仔是在吠啥咪\n\n幹~~~~~~!\n\n你家ㄟ狗仔就雞歪\n你家ㄟ狗仔就雞歪\n你家ㄟ狗仔就雞歪\n你這個主人嘛真雞歪\n\n你這個主人是在衝啥小\n我看你連飼狗仔攏袂會\n你家ㄟ狗仔歸眠勒哭夭\n吵呷你爸勇欲擋袂住\n\n你家ㄟ狗仔就雞歪\n你家ㄟ狗仔就雞歪\n你家ㄟ狗仔就雞歪\n你這個主人嘛真雞歪', '', 225, '', '電子：KS (Kevin Su)、薨樂團 (Demise) [原：四人幫]', '薨樂團 (Demise) [原：四人幫]', 'KS (Kevin Su)', '凱斯音樂', '', 0, 1, 0, '2008-12-28 11:47:43', '2015-03-12 13:36:16', '0000-00-00 00:00:00'),
(11404, 7871, 0, 1, 'Introduction by Stan Cash', '黑夜的藍寶石 映出人心的貪婪和荒誕，航空版！粗顆粒！超逼真！\r\n\r\n這不是樂活 也沒有花草 而是真正的舒壓\r\n\r\n時下風行的療癒系音樂，打著樂活旗幟，一時間少男少女趨之若鶩\r\n然久而久之卻產生水土不服，全城一片虛無景象，不知為何而戰 ?!\r\n為解救學習成長中的青少年於日本、英吉力和亞美利堅所編織的花草謊言及夾洋自重之權威人士的陷阱\r\n\r\n本公司特製作本張專輯「藍寶石」，針對進口的療癒系音樂做改良\r\n結合在地特色，多點情趣，才能真正達到舒壓效果!!\r\n', '2012-10-03 00:00:00', 0000, 0, 2, 7, '', '', 21, '', '柯仁堅', '柯仁堅', '濁水溪公社', '喜馬拉雅唱片', '', 1, 0, 0, '2008-12-28 16:40:36', '2015-03-12 13:36:16', '0000-00-00 00:00:00'),
(11405, 7871, 0, 2, '無解', '帶領觀眾走進黑暗風暴中心，一件光怪陸離的懸疑刑案，一顆命運的藍寶石，改變了每一個人，森林竄出烈焰，破碎鑽石刺傷眼睛！', '2008-12-26 00:00:00', 0000, 0, 2, 7, '', '', 43, '', '柯仁堅', '柯仁堅', '濁水溪公社', '喜馬拉雅', '', 1, 0, 0, '2008-12-28 16:44:46', '2015-03-12 13:36:16', '0000-00-00 00:00:00'),
